        <label>
            Full Name:
            <input
            name="Full Name"
            type='text'
            value={fullName}
            onChange={e => setFullName(e.target.value)}
             />
        </label>
        <label>
            Email Address:
        <input
        name="Email Address"
        type='text'
        value={email}
        onChange={e => setEmail(e.target.value)}
        />
        </label>
        <label>
            User ID:
            <input
            name="User ID"
            type='text'
            value={userID}
            onChange={e => setUserID(e.target.value)}
            />
        </label>
        <label>
            Password:
            <input
            name="Password"
            type='password'
            value={password}
            onChange={e => setUserID(e.target.value)}
            />
        </label>
        <button>Create Account</button>




        </Content>
        </form>
        </contianer>
    );
}

export default CreateAccount;
